import React, {Component} from 'react';
import Navbar from './components/layout/Navbar';
import Users from './components/users/Users';
import './App.css';

class App extends Component {
componentDidMount() {
  fetch('https://api.github.com/users')
  .then(function(res){
    return res.json();
  })
  .then(function (data){
    console.log(data);
  });
}

  render(){
    return (
      <div className='App'>
        <Navbar/>
        <div className="container">
        <Users/>
        </div>
      </div>
       );
  }
}

export default App;
